import React from 'react';

function Dashboard() {
  return (
    <div style={{color:'white', fontSize:'20px'}}>
      <h1 style={{marginLeft:'10px'}}>Dashboard</h1>
      <p>Welcome to your ! Here you can see your grades, assignments, and other important information.</p>
      <div>
        <h2>Grades</h2>
        <table>
          <thead>
            <tr>
              <th>Subject</th>
              <th />
              <th>Grade</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Math</td>
              <td />
              <td>A-</td>
            </tr>
            <tr>
              <td>English</td>
              <td />
              <td>B+</td>
            </tr>
            <tr>
              <td>Science</td>
              <td />
              <td>B</td>
            </tr>
          </tbody>
        </table>
      </div>
      <div>
        <h2>Assignments</h2>
        <ul>
          <li>Math - Chapter 5 Practice Problems</li>
          <li>English - Essay on "To Kill a Mockingbird"</li>
          <li>Science - Lab report on Photosynthesis</li>
        </ul>
      </div>
    </div>
  );
}

export default Dashboard;
